import styles from './styles.module.scss';
import HeroImage from '../../components/project/heroImage';
import Sidebar from '../../components/shared/sidebar';
import Overview from '../../components/project/overview';
import BackButton from '../../components/shared/backButton'

function Project() {
    return (
        <> 
            <Sidebar 
                topContent = {[
                    <BackButton url = '../home' />
                ]}
                bottomLinks = {[
                    'Overview',
                    'Problem',
                    'Solution',
                ]}
            />
            <div className={styles.main}>
                <h1>Bits of Good</h1>
            </div>
            <div className={styles.img}>
                <HeroImage imgUrl = 'asset/imgs/gen_soln-1.jpg'/>
            </div>
            <div className={styles.main}>
                <Overview 
                    header = 'Helping small-scale non-profits grow their donor and volunteer base.'
                    body = 'Working with a team of 10+ student volunteer designers, engineers, and product managers, wanted to envision how our student organization could better address the needs of our smaller non-profit clients.'
                    client = 'Student Org'
                    date = 'Fall 2020'
                    role = 'Product Design'
                />
            </div>
        </>
    )
}

export default Project;
